import './App.css'
import './components/Components.css'
import Home from './components/Home';
import About from './components/About';
import Projects from './components/Projects';

function App() {
  return (
    <div className="App">
      <body>
        <Home/>
        <About/>
        <Projects/>
      </body>
    </div>
  );
}

export default App;
